DROP TABLE IF EXISTS `tb_product`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `tb_product` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `productname` varchar(50) DEFAULT NULL COMMENT '商品名称',
  `wordcode_1` varchar(50) DEFAULT NULL COMMENT '国际码第1段：款式',
  `wordcode_2` varchar(50) DEFAULT NULL COMMENT '国际码第2段：尺码',
  `wordcode_3` varchar(50) DEFAULT NULL COMMENT '国际码第3段：颜色',
  `wordcode_4` varchar(50) DEFAULT NULL COMMENT '国际码第4段：自定义的部分',
  `wordcode` varchar(200) DEFAULT NULL COMMENT '国际码',
  `wordprice` decimal(16,2) DEFAULT NULL COMMENT '国际零售价',
  `wordpricecurrency` int(10) DEFAULT NULL COMMENT '国际零售价币种',
  `gender` varchar(100) DEFAULT NULL COMMENT '0-女式 1-男士 2-中性',
  `brandid` int(10) unsigned DEFAULT NULL COMMENT '品牌',
  `brandgroupid` int(10) unsigned DEFAULT NULL COMMENT '品类',
  `childbrand` int(10) unsigned DEFAULT NULL COMMENT '子品类',
  `brandcolor` int(10) unsigned DEFAULT NULL COMMENT '色系id',
  `picture2` varchar(100) DEFAULT NULL COMMENT '副图',
  `picture` varchar(100) DEFAULT NULL COMMENT '主图',
  `ageseason` varchar(200) DEFAULT NULL COMMENT '年代',
  `ageseason_season` varchar(45) NOT NULL DEFAULT '' COMMENT '年代拆分出的季节，只保留最新的',
  `ageseason_year` varchar(45) NOT NULL DEFAULT '' COMMENT '年代拆分出的年份，只保留最新的',
  `countries` varchar(100) DEFAULT NULL COMMENT '产地',
  `material` int(10) unsigned DEFAULT NULL COMMENT '材质',
  `producttemplate` int(10) unsigned DEFAULT NULL COMMENT '商品尺码描述',
  `spring` tinyint(1) DEFAULT '0' COMMENT '是否春季：0-否；1-是',
  `summer` tinyint(1) DEFAULT '0' COMMENT '是否夏季：0-否；1-是',
  `fall` tinyint(1) DEFAULT '0' COMMENT '是否秋季：0-否；1-是',
  `winter` tinyint(1) DEFAULT '0' COMMENT '是否冬季：0-否；1-是',
  `laststoragedate` varchar(19) DEFAULT NULL COMMENT '最后入库时间',
  `aliases` varchar(100) DEFAULT NULL COMMENT '别名',
  `series` varchar(100) DEFAULT NULL COMMENT '系列1',
  `series2` varchar(100) DEFAULT NULL COMMENT '系列2',
  `ulnarinch` varchar(200) DEFAULT NULL COMMENT '商品尺寸',
  `factoryprice` decimal(16,2) DEFAULT NULL COMMENT '出厂价',
  `factorypricecurrency` int(10) DEFAULT NULL COMMENT '出厂价币种',
  `nationalfactoryprice` decimal(16,2) DEFAULT NULL COMMENT '国内出厂价',
  `nationalfactorypricecurrency` int(10) DEFAULT NULL COMMENT '国内出厂价币种',
  `product_group` varchar(200) DEFAULT NULL COMMENT '同款不同色数据',
  `nationalpricecurrency` int(4) DEFAULT NULL COMMENT '本国零售价币种',
  `nationalprice` decimal(16,2) DEFAULT NULL COMMENT '国内价格',
  `memo` varchar(100) DEFAULT NULL COMMENT '备注',
  `sizecontentids` varchar(100) DEFAULT NULL COMMENT '尺码ids',
  `sizetopid` int(11) DEFAULT NULL COMMENT '尺码模板',
  `companyid` int(11) DEFAULT NULL COMMENT '公司id',
  `makestaff` int(11) DEFAULT NULL COMMENT '建档人',
  `productmemoids` varchar(300) DEFAULT NULL COMMENT '商品描述表id列表',
  `updatetime` datetime DEFAULT NULL COMMENT '更新时间',
  `maketime` datetime DEFAULT NULL COMMENT '创建时间',
  `colorname` varchar(100) DEFAULT NULL COMMENT '品牌颜色名称',
  `saletypeid` int(11) DEFAULT NULL COMMENT '销售属性',
  `producttypeid` int(11) DEFAULT '0' COMMENT '商品属性',
  `winterproofingid` int(11) DEFAULT NULL COMMENT '防寒指数',
  `cost` decimal(16,2) DEFAULT NULL COMMENT '成本',
  `costcurrency` int(11) DEFAULT NULL COMMENT '成本货币单位',
  `color_system_id` int(10) unsigned DEFAULT NULL COMMENT '色系id',
  `color_id` int(10) unsigned DEFAULT NULL COMMENT '主颜色id',
  `second_color_id` int(10) unsigned DEFAULT NULL COMMENT '副颜色id',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1479 DEFAULT CHARSET=utf8mb4 ROW_FORMAT=COMPACT COMMENT='商品表';
